import React from 'react'

const QuestionCategory = ({categorie, index, quizCat }) => {
    return (
        <article>
            return (
            <li onClick={() => { quizCat(index) }} value={categorie} className="listItem" key={index}>{categorie}</li>
            )
        </article >
    )
}
export default QuestionCategory;
